import React from 'react';
import { Link } from 'react-router-dom';

export default function HomeScreen() {
  return (
    <div className='container'>
      <Link to='/enquiry'><h2 style={{padding:'10px', fontSize:'30px'}}>Enquiry</h2></Link>
      
      <Link to='/order'><h2 style={{padding:'10px', fontSize:'30px'}}>Order</h2></Link>
      <Link to='/account'><h2 style={{padding:'10px', fontSize:'30px'}}>Account</h2></Link>
    
    </div>
  );
}
